import {React, useState, useEffect} from "react";
import {StyleLogg} from './Form.styles.js'

const Logg = (props) => {
    console.log(props.scooter.scooter)
    const [logg, setLogg] = useState({})

    useEffect(() => {
        setLogg(props.scooter.scooter)
    }, [props])

    useEffect(() => {
    }, [setLogg, logg])

    return (
        <>
        <StyleLogg>
        {logg && logg.logg ? (
        <table>
            <caption>Logg</caption>
            <thead>
                <tr>
                    <th scope="col">Användare</th>
                    <th scope="col">Startposition</th>
                    <th scope="col">Starttid</th>
                    <th scope="col">Slutposition</th>
                    <th scope="col">Stopptid</th>
                    <th scope="col">Event</th>
                </tr>
            </thead>
            <tbody>

                {logg.logg.map(elem => 
                <tr>
                    <td data-label="Användare"> {elem.user}</td>
                    <td data-label="Startposition (lat)"> {elem.start.position.lat}  </td>
                    <td data-label="Startposition (lng)">  {elem.start.position.lng } </td>

                    <td data-label="Starttid">{elem.start.time} </td>
                    <td data-label="Slutposition"> {elem.end.position.lat, elem.end.position.lng}</td>
                    <td data-label="Stopptid"> {elem.end.time}</td>
                    <td data-label="Event" > {elem.event} </td>
                </tr>
                )}


            </tbody>
            </table>
        ): (
            console.log("HEj")
         )}

        </StyleLogg>
        </>
    )

}

export default Logg
